    {
        this->layers = layers;
    }
    vector<double> predict(vector<double> input)
    {
        for(int k = 0; k < layers.size() - 2; k++)
        {
            input = dot(W[k], input, b[k], 0);
        }
        input = dot(W[layers.size() - 2], input, b[layers.size() - 2], 1);
        return input;
    }

    void init_params(vector<int> ls)
    {

        layers = ls;
        for(int k = 0; k < layers.size() - 1; k++)
        {

            for(int i = 0; i < layers[k]; i++)
            {
                for(int j = 0; j < layers[k + 1]; j++)
                {
                    W[k][j][i] = distribution(generator);
                    b[k][j][0] = (double)rand() / RAND_MAX;
                }
            }
        }
    }

    Model breed(Model model)
    {

        for(int k = 0; k < layers.size() - 1; k++)
        {
            for(int i = 0; i < layers[k]; i++)
            {
                for(int j = 0; j < layers[k + 1]; j++)
                {
                    model.W[k][j][i] = choice(model.W[k][j][i], W[k][j][i]);
                    model.b[k][j][0] = choice(model.b[k][j][0], b[k][j][0]);
                }
            }
        }
        return model;
    }
